import React from 'react';

class Card extends React.Component {
	render() {
		return (
			<div className="ui card">
				<div className="image">
					<img alt="abstract" src={this.props.image} />
				</div>
				<div class="content">
					<div className="header">
						{this.props.title}
					</div>
				</div>
				<div class="content">
					<div className="description">
						{this.props.description}
					</div>
				</div>
	
				<div class="extra content">
					<div class="ui two buttons">
						<a><div class="ui basic button">{this.props.link1}</div></a>
						<a><div class="ui basic button">{this.props.link2}</div></a>					
					</div>
				</div>
	
			</div>
	
		);
	}
}



export default Card;
